document.write("<script language=\"Javascript\">\nvar kAds = new Array();\nkAds[0] = \'<img src=\"/art/RightBlackTri.gif\" border=\"0\">&nbsp;<a href=\"javascript:void(0)\" onClick=\"openTopad_2646(1795583);\">ADVERTISING SALES REPRESENTATIVE</a><br>\';\nkAds[1] = \'<img src=\"/art/RightBlackTri.gif\" border=\"0\">&nbsp;<a href=\"javascript:void(0)\" onClick=\"openTopad_2646(1866429);\">BEHAVIORIST</a><br>\';\nkAds[2] = \'<img src=\"/art/RightBlackTri.gif\" border=\"0\">&nbsp;<a href=\"javascript:void(0)\" onClick=\"openTopad_2646(1900686);\">Data Entry</a><br>\';\nkAds[3] = \'<img src=\"/art/RightBlackTri.gif\" border=\"0\">&nbsp;<a href=\"javascript:void(0)\" onClick=\"openTopad_2646(1900690);\">C-3 LICENSED COLLECTION SYSTEMS OPERATOR</a><br>\';\nkAds[4] = \'<img src=\"/art/RightBlackTri.gif\" border=\"0\">&nbsp;<a href=\"javascript:void(0)\" onClick=\"openTopad_2646(1900697);\">Customer Service Logistics Coordinator</a><br>\';\nkAds[5] = \'<img src=\"/art/RightBlackTri.gif\" border=\"0\">&nbsp;<a href=\"javascript:void(0)\" onClick=\"openTopad_2646(1900702);\">PRE SCHOOL Teacher</a><br>\';\nkAds[6] = \'<img src=\"/art/RightBlackTri.gif\" border=\"0\">&nbsp;<a href=\"javascript:void(0)\" onClick=\"openTopad_2646(1900706);\">ADMIN ASSISTANT</a><br>\';\nkAds[7] = \'<img src=\"/art/RightBlackTri.gif\" border=\"0\">&nbsp;<a href=\"javascript:void(0)\" onClick=\"openTopad_2646(1900708);\">ADMINISTRATIVE ASSISTANT</a><br>\';\nkAds[8] = \'<img src=\"/art/RightBlackTri.gif\" border=\"0\">&nbsp;<a href=\"javascript:void(0)\" onClick=\"openTopad_2646(1900742);\">TECHNICIAN</a><br>\';\nkAds[9] = \'<img src=\"/art/RightBlackTri.gif\" border=\"0\">&nbsp;<a href=\"javascript:void(0)\" onClick=\"openTopad_2646(1904609);\">WAREHOUSE MANAGER</a><br>\';\nkAds[10] = \'<img src=\"/art/RightBlackTri.gif\" border=\"0\">&nbsp;<a href=\"javascript:void(0)\" onClick=\"openTopad_2646(1916770);\">Receptionist/Admin Assistant & Bookkeeper</a><br>\';\nkAds[11] = \'<img src=\"/art/RightBlackTri.gif\" border=\"0\">&nbsp;<a href=\"javascript:void(0)\" onClick=\"openTopad_2646(1918353);\">CUSTOMER SERVICE</a><br>\';\n\n\nTopAds_Show(0, 10, \'<div align=\"center\" style=\"padding-top:10px;\"><table width=\"135\" border=\"0\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\" id=\"modules\">  <tr>    <td align=\"center\" valign=\"top\">	  <h1>Jobberwocky<br/>Top Jobs</h1>    </td>  </tr>  <tr>    <td valign=\"top\" align=\"left\">\', \'</td></tr><tr><td valign=\"top\" align=\"center\"><a href=\"/shared-content/topads/moreads.php?moduleid=2646&stereotype=1\" target=\"_blank\">More Jobs</a>    </td>  </tr></table></div>\');\n\n//Writes out the full module display content by showing the header, random ads, and the footer\nfunction TopAds_Show(bHorizontal, nAdsToShow, sHeader, sFooter)\n{\n  var nRand;\n\n  //Check to see if the number of ads to show is set higher than the number of ads\n  //This would cause an infinite loop if we did not do this check\n  if (kAds.length < nAdsToShow)\n  {\n    nAdsToShow = kAds.length;\n  }\n\n  document.write(sHeader);\n\n  // If we are generating a horizontal module, we place the\n  // whole element in a table\n  if (bHorizontal)\n  {\n    document.write(\"<table border=\\\"0\\\">\");\n    document.write(\"<tr>\");\n  }\n\n  while((nAdsToShow > 0) && kAds.length)\n  {\n    nRand = Math.floor(Math.random() * kAds.length);\n\n    if (bHorizontal)\n    {\n      document.write(\"<td>\" + kAds[nRand] + \"</td>\");\n    }\n    else\n    {\n      document.write(kAds[nRand]);\n    }\n\n    // We use a \"cheap\" method for reducing the array because\n    // of cross browser issues with pop() and splice()\n    if (nRand != kAds.length)\n    {\n      kAds[nRand] = kAds[kAds.length-1];\n    }\n    kAds.length--;\n    nAdsToShow--;\n  }\n\n  // If we are generating a horizontal module, end the table\n  if (bHorizontal)\n  {\n    document.write(\"</tr>\");\n    document.write(\"</table>\");\n  }\n\n  document.write(sFooter);\n}\n\n//Opens the topads window to the correct location for the passed ad identification number\nfunction openTopad_2646(nAdID)\n{\n  sURL = \'http://www.recordernewspapers.com/shared-content/topads/show.php?adid=\' + nAdID;\n  sName = \'win\' + nAdID;\n  newwindow = window.open(sURL,sName,\'scrollbars=1,width=0,height=0,resizable=1,status=0,location=0,menubar=0,toolbar=0\');\n}\n</script>");